class Solution:    def findDiagonalOrder(self, matrix):        """        :type matrix: List[List[int]]        :rtype: List[int]        """        if len(matrix)==0 or len(matrix[0])==0:            return []        i,j,ans=0,0,[]        m,n=len(matrix),len(matrix[0])        while i<=m-1 and j<=n-1:            while i>=0 and j<=n-1:                ans.append(matrix[i][j])                i-=1                j+=1            if j<=n-1:                i+=1            else:                i+=2                j=n-1            while i<=m-1 and j>=0:                ans.append(matrix[i][j])                i+=1                j-=1            if i<=m-1:                j+=1            else:                j+=2                i=m-1        return ans